import React from 'react';

export default class ArchivePage extends React.Component {
    componentDidMount(){
        fetch("/listarchives")
        .then((res) => res.json())
        .then((data) => this.setState({archives:data.archives}))
        .catch((err) => {
            console.error('Failed to get session creddentials', err);
            alert('Failed to get opentok sessionId and token');
        });

    };

    constructor(props) {
        super(props);

        this.state = {
            archives:"",
        };

    };


    render() {
        return (
            <div>
                <h3>Archiving List</h3>
                <table class="table table-striped">
                    <thead>
                    <tr>
                        <th scope="col">Name</th>
                        <th scope="col">Time</th> 
                        <th scope="col">Status</th>
                        <th scope="col">Archive ID</th> 
                    </tr>
                    </thead>
                    <tbody>

                    </tbody>
                </table>
            </div>
        );
    };
}
